	add("electionspeak", "{\"term\":\"electionspeak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|election|speak|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The jargon or rhetoric of politicians, lobbyists, and commentators during an election campaign\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027India Today International\u0027, Volume 24, [https://books.google.com/books?id\u003dQ0AWAQAAMAAJ\u0026amp;q\u003d%22electionspeak%22 page 276\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bolstered claims of mustering a simple majority are an integral part of \u0027\u0027electionspeak\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, David Marsh, \u0027For Who the Bell Tolls: One Man\u0027s Quest for Grammatical Perfection\u0027, Faber and Faber Ltd (2013), ISBN 9781783350131, [https://books.google.com/books?id\u003dYdsiAQAAQBAJ\u0026amp;pg\u003dPT145\u0026amp;dq\u003d%22electionspeak%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Such mindless, meaningless \u0027\u0027electionspeak\u0027\u0027 brought to mind the words of Orwell\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Marybeth Hicks, \u0026quot;[http://www.washingtontimes.com/news/2013/feb/13/media-waste-no-time-to-display-ignorance/ Media waste no time to display ignorance]\u0026quot;, \u0027The Washington Times\u0027, 13 February 2013\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Accustomed as they are to \u0027\u0027electionspeak\u0027\u0027, the mainstream media can’t seem to fathom that the selection of a pope is an altogether different sort of thing\", \"priority\":7}]}, \"synonyms\":{}}");

