	add("electrograph", "{\"term\":\"electrograph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|graph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A machine used in gravure printin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A recording electrometer; the graph produced by such a devic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An instrument for the reproduction at a distance of pictures, maps, etc., by means of electricity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sciagraph\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A cinematograph using the arclight\", \"priority\":5}]}, \"synonyms\":{}}");

	add("electrography", "{\"term\":\"electrography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"gravure printin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The recording of the electrical activity of part of the body\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electrogravimetry", "{\"term\":\"electrogravimetry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|gravimetry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gravimetric form of electroplating used as an analytic technique\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrogravitics", "{\"term\":\"electrogravitics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|gravity|ics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a proposed science involving the use of an electric field to charge (or polarize) an object so as to counteract the effects of gravity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrohomeopathy", "{\"term\":\"electrohomeopathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|homoeopathy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A nineteenth-century form of homeopathy based on electrical energy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrohydrodynamics", "{\"term\":\"electrohydrodynamics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|hydrodynamics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the study of the dynamics of electrically conducting fluid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrohypersensitivity", "{\"term\":\"electrohypersensitivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|hypersensitivity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supposed abnormal sensitivity to the presence of electric fields or to electromagnetic radiation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrokinesis", "{\"term\":\"electrokinesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|kinesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transport of particles or fluid by means of an electric field acting on a fluid which has a net mobile charge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The generation of electrical force using the mind alone\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electrokinetics", "{\"term\":\"electrokinetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|kinetics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the electrodynamics of electrical circuits\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrolarynx", "{\"term\":\"electrolarynx\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|larynx|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of mechanical larynx to assist those who have lost their original voicebox to produce clearer speech\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electroloading", "{\"term\":\"electroloading\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|loading|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The injection of a drug etc. into a cell by electroporation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrolocation", "{\"term\":\"electrolocation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|electric|location|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the ability of an animal to detect an object by its distortion of the animal\u0027s electric field, as in the electric fishes such as the electric eel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the ability of a robot to locate an object by detecting changes in its electric field\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electroluminescence", "{\"term\":\"electroluminescence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|luminescence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The generation of light by the application of an alternating current to a semiconductor or phosphor, or by an electric discharge through a gas\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrolysis", "{\"term\":\"electrolysis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Introduced by w:Faraday|Faraday on the suggestion of the Rev. w:William Whewell|William Whewell, from {{confix|electro|lysis|gloss2\u003da loosening|lang\u003den}}. Originally of tumors, later (1909) of hair removal.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the chemical change produced by passing an electric current through a conducting solution or a molten sal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the destruction of hair roots by means of an electric current\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electrolyte", "{\"term\":\"electrolyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a substance that, in solution or when molten, ionizes and conducts electricit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any of the various ions (such as sodium or chloride) that regulate the electric charge on cells and the flow of water across their membranes\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electromagnet", "{\"term\":\"electromagnet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|magnet|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A magnet which attracts metals only when electrically activated\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electromagnetics", "{\"term\":\"electromagnetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|magnetics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"electricity and magnetism, collectively, as a field of study\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electromagnetism", "{\"term\":\"electromagnetism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|magnetism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unified fundamental force that combines the aspects of electricity and magnetism and is one of the four fundamental forces. (technically it can be unified with weak nuclear to form electroweak) Its gauge boson is the photon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Electricity and magnetism, collectively, as a field of study\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electromechanics", "{\"term\":\"electromechanics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|mechanics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the engineering aspects of devices that are controlled by electrostatics or electromagnetics\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrometallurgy", "{\"term\":\"electrometallurgy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|metallurgy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The deposit of a metal coating on a prepared surface by electrochemical means, as in electroplating and electrotyping\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrometry", "{\"term\":\"electrometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|metry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the art or process of taking electrical measurements\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electromotor", "{\"term\":\"electromotor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|motor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any device that generates electricit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any device that converts electricity into motion\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electromyography", "{\"term\":\"electromyography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|myography|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a technique for evaluating and recording the activation signal of muscles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electron", "{\"term\":\"electron\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027electric\u0027 + \u0027ion\u0027 originally proposed as the name for the electric charge associated with a univalent ion. Compare \u0027\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The subatomic particle having a negative charge and orbiting the nucleus; the flow of electrons in a conductor constitutes electricity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Alloys of magnesium and other metals, like aluminum or zinc, that were manufactured by the German company Chemische Fabrik Griesheim-Elektron\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electronarcosis", "{\"term\":\"electronarcosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|electro|narcosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the process of rendering one unconscious through the application of an electric curren\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the unconsciousness induced as a result of the process\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electronegativity", "{\"term\":\"electronegativity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|negativity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the tendency, or a measure of the ability, of an atom or molecule to attract electrons and thus form bonds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electronica", "{\"term\":\"electronica\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a wide range of electronic music genres\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Michael Campbell, \u0027Popular Music in America: The Beat Goes On\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By mid-decade, \u0027\u0027electronica\u0027\u0027 began to chart, in the music of acts such as Bjork, Chemical Brothers, and Moby, and the resources of electronica were integrated into other non-pop styles, such as the industrial music of Trent Reznor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Timothy D. Taylor, \u0027Strange Sounds: Music, Technology and Culture\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"New Age music like all musics, has its margins, and these are blurred with ambient, techno, and other \u0027\u0027electronica\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Electronic items in general\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The data trail of an individual on the public internet\", \"priority\":7}]}, \"synonyms\":{}}");

	add("electronystagmography", "{\"term\":\"electronystagmography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|nystagmography|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diagnostic test to record involuntary movements of the eye caused by a condition known as nystagmus. It can also be used to diagnose the cause of vertigo, dizziness or balance dysfunction by testing the vestibular system\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrooptics", "{\"term\":\"electrooptics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|optics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the effects of an electric field on the optical properties of a material\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electroosmosis", "{\"term\":\"electroosmosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|osmosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the migration of ions in a solvent through the capillaries of a membrane under the influence of an applied electric field\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrophile", "{\"term\":\"electrophile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|phile|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a compound or functional group that is attractive to, and accepts electrons, especially accepting an electron pair from a nucleophile to form a bond\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrophone", "{\"term\":\"electrophone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|phone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any instrument designed to create sounds using electrical currents\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrophosphorescence", "{\"term\":\"electrophosphorescence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|phosphorescence|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of phosphorescence, especially in doped LEDs, that is triggered by an electric charge\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrophotography", "{\"term\":\"electrophotography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|photography|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any of several methods of photocopying in which an image is created and then transferred between surfaces using static electricity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrophysiology", "{\"term\":\"electrophysiology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|physiology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the branch of physiology that studies the electrical activity of organisms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electropolymerization", "{\"term\":\"electropolymerization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|polymerization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"polymerization under the influence of an electric current\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electroporation", "{\"term\":\"electroporation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|poration|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the creation of transient pores in the cell membrane, through the application of a high-voltage electrical pulse\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electropositivity", "{\"term\":\"electropositivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|positivity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the condition of being electropositiv\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a measure of the extent to which something is electropositive\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electroreception", "{\"term\":\"electroreception\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|reception|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The biological ability to perceive electrical impulses, used for electrolocation and electrocommunication and particularly common among aquatic creatures (since salt water is a more efficient conductor than air\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrorefining", "{\"term\":\"electrorefining\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|refining|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process, similar to electrowinning, for the removal of impurities from a metal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electroretinography", "{\"term\":\"electroretinography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|retina|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a diagnostic test to used to measure the electrical responses of various cell types in the retina\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrorheology", "{\"term\":\"electrorheology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|rheology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the effects of electric fields on the rheological properties of materials\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electroscope", "{\"term\":\"electroscope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|scope|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a simple device that detects the presence of an electric charge by the mutual repulsion of metal foils or pith balls\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrosensibility", "{\"term\":\"electrosensibility\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|sensibility|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The (real or imagined) ability to perceive the presence of electric fields or electromagnetic radiation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrosensitivity", "{\"term\":\"electrosensitivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|sensitivity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being sensitive to electricity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electroshock", "{\"term\":\"electroshock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|shock|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"electroconvulsive Electroconvulsive therapy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrosleep", "{\"term\":\"electrosleep\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|sleep|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"sleep induced by cranial electrotherapy stimulation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrostatics", "{\"term\":\"electrostatics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|statics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the branch of physics that deals with static electricity; that is, with the force exerted by an unchanging electric field upon a charged object\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrotaxis", "{\"term\":\"electrotaxis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|taxis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"movement of an organism or system of cells in an electric field\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrotechnology", "{\"term\":\"electrotechnology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|technology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"electrical technology and engineering\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrotherapy", "{\"term\":\"electrotherapy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|therapy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of electrical energy as a medical treatment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrothermy", "{\"term\":\"electrothermy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|electro|thermy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The electrical generation of hea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The therapeutic application of such heat\", \"priority\":2}]}, \"synonyms\":{}}");

	add("electrotonus", "{\"term\":\"electrotonus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The variation of the excitability and conductivity of a nerve or muscle as an electric current passes through it\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrotropism", "{\"term\":\"electrotropism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|electro|tropism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Growth or motion in response to an electric field\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrotype", "{\"term\":\"electrotype\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|type|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a plate, made by electroplating a mold, such as used in letterpress printing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrotyping", "{\"term\":\"electrotyping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|electrotype|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act or process of making electrotypes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrowinning", "{\"term\":\"electrowinning\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|electro|winning|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The electrodeposition of metals from their ores that have been put in solution or liquefied\", \"priority\":1}]}, \"synonyms\":{}}");

	add("electrum", "{\"term\":\"electrum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027electrum\u0027 from Ancient greek (to 1453) \u0027ἤλεκτρον\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Amber\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An alloy of gold and silver, used by the ancients; now specifically a natural alloy with between 20 and 50 per cent silver\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Paul T. Craddock, \u0027Early Metal Mining and Production\u0027, page 111\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Native gold almost always contains silver in amounts varying widely between 5 and 50 per cent. This natural alloy is known as electrum although in classical antiquity where the word originated it seems to have been used for an artificial alloy of the two metals\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Philip Ball, \u0027The Elements: A Very Short Introduction\u0027, Oxford 2004, p. 45\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A natural alloy containing more than 20 per cent silver is called \u0027\u0027electrum\u0027\u0027, and was regarded by the ancients as a different metal from gold\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"German silver plate\", \"priority\":7}]}, \"synonyms\":{}}");

	add("elemi", "{\"term\":\"elemi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tree, native to the Philippines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A resin harvested from the elemi tree\", \"priority\":2}]}, \"synonyms\":{}}");

	add("element", "{\"term\":\"element\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027element\u0027 from Old french (842-ca. 1400) \u0027element\u0027 from Latin \u0027elementum\u0027 (a first principle, element, rudiment) origin uncertain. Perhaps ultimately from \u0027L M N\u0027, first three letters of the second half of the Canaanite alphabet, recited by ancient scribes when learning it (in sense compare English \u0027abc\u0027 . This idea has been criticized though due to the absence of any evidence for use of a half-split in the Latin alphabet itself and the lack of evidence for the use of \u0026quot;el\u0026quot;, \u0026quot;em\u0026quot;, and \u0026quot;en\u0026quot; as letter names in early Latin. An alternative related idea is that \u0027elementum\u0027 was borrowed into Latin from a Semitic term (probably via Egyptian) \u0027halaḥama\u0027, which derives from the old South Semitic initial character sequence, h-l-ḥ-m..., though this theory presents some difficulties as well. The equivalent Greek term \u0027στοιχεῖον\u0027 (element, letter) (introduced in the sense of \u0026quot;element\u0026quot; by Plato), like the Latin \u0027elementum\u0027, has the dual meaning of \u0026quot;element\u0026quot; and \u0026quot;letter,\u0026quot; which does suggest that the semantic connection between these ideas could be quite old.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the simplest or essential parts or principles of which anything consists, or upon which the constitution or fundamental powers of anything are based\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1817-1893\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The simplicity which is so large an \u0027\u0027element\u0027\u0027 in a noble nature was laughed to scorn\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any one of the simplest chemical substances that cannot be decomposed in a chemical reaction or by any chemical means and made up of atoms all having the same number of protons\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the four basic building blocks of matter in theories of ancient philosophers and alchemists: water, earth, fire, and air\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A required aspect or component of a cause of action. A deed is regarded a violation of law only if each element can be proved\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One of the objects in a set\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A small part of the whole\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Atmospheric forces such as strong winds and rains\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A place or state of being that an individual or object is better suited towards\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The bread and wine taken at Holy Communion\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A group of people within a larger group having a particular common characteristic\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A short form of heating element, a component in electrical equipment, often in the form of a coil, having a high resistance, thereby generating heat when a current is passed through it\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"One of the conceptual objects in a markup language, usually represented in text by a matching pair of tags\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Richard Wagner, \u0027Creating Web Pages All-in-One For Dummies\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The div \u0027\u0027element\u0027\u0027 was introduced into HTML as a solution to the layout problem\", \"priority\":16}]}, \"synonyms\":{}}");

