	add("elements", "{\"term\":\"elements\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Outdoor weather, such as wind or rain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The basic tenets of an area of knowledge\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The bread and wine of the eucharist\", \"priority\":3}]}, \"synonyms\":{}}");

	add("elenchus", "{\"term\":\"elenchus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἔλεγχος\u0027 (refutation, scrutiny)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A technique of argument associated with Socrates wherein the arguer asks the interlocutor to agree with a series of premises and conclusions, ending with the arguer\u0027s intended point\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Thomas c. Brickhouse and Nicholas D. Smith, “Socrates’ Elenctic Mission”, in \u0027Oxford Studies in Ancient Philosophy\u0027, Volume IX (1991),\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dx3oPZGGYZlcC ]\u0026lt;/sup\u0026gt; Oxford University Press, ISBN 978-0-19-823990-1, page 131–132\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027elenchus\u0027\u0027 begins when an interlocutor makes some moral claim that Socrates wishes to examine. The argument then proceeds from premisses \u0026lt;!-- [sic] double-s --\u0026gt; that express certain of the interlocutor’s other beliefs to a conclusion that contradicts the original moral claim under scrutiny\", \"priority\":3}]}, \"synonyms\":{}}");

	add("elephant", "{\"term\":\"elephant\", \"etymology\":{\"influencers\":[], \"languages\":[\"egyptian (ancient)\", \"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Middle english (1100-1500) {{m|enm|elefant}}, {{m|enm|elefaunt}}, from Old french (842-ca. 1400) {{m|fro|elefant}}, {{m|fro|elefan}}, {{m|fro|olifant}}, re-latinized in Middle french (ca. 1400-1600) as {{m|frm|elephant}}, from Latin {{m|la|elephantus}}, from Ancient greek (to 1453) {{m|grc|ἐλέφᾱς}} (gen. {{m|grc|ἐλέφαντος}}). Believed to be derived from an Afro-Asiatic form such as Proto-berber {{m|ber-pro|*eḷu||elephant}} (compare Tamahaq (Tahaggart) {{m|thv|êlu}}, (Ghat) {{m|taq|alu}}) or Egyptian (ancient) {{m|egy|𓍋𓃀𓅱𓌟|tr\u003dȝbw|sc\u003dEgyp}} (\u0027ābu\u0027) ‘elephant; ivory’. More at ivory. Replaced Middle English {{m|enm|olifant}}, which replaced Old English {{m|ang|elpend}}, {{m|ang|olfend}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:African Bush Elephant Mikumi right|thumb|An African bush elephant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mammal of the order \u0027Proboscidea\u0027, having a trunk, and two large ivory tusks jutting from the upper jaw\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything huge and ponderous\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A printing-paper size measuring 30 inches x 22 inches\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"used when counting to add length, so that each count takes about one second\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Let\u0027s play hide and seek. I\u0027ll count. One \u0027\u0027elephant\u0027\u0027, two \u0027\u0027elephant\u0027\u0027, three \u0027\u0027elephant\", \"priority\":6}]}, \"synonyms\":{}}");

