	add("elevation", "{\"term\":\"elevation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027elevation\u0027 from Latin \u0027elevatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of raising from a lower place, condition, or quality to a higher; said of material things, persons, the mind, the voice, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027elevation\u0027\u0027 of grain; \u0027\u0027elevation\u0027\u0027 to a throne; \u0027\u0027elevation\u0027\u0027 to sainthood; \u0027\u0027elevation\u0027\u0027 of mind, thoughts, or character\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The condition of being or feeling elevated; heightened; exaltation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That which is raised up or elevated; an elevated place or station\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A hill is an \u0027\u0027elevation\u0027\u0027 of the ground\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The distance of a celestial object above the horizon, or the arc of a vertical circle intercepted between it and the horizon; altitude\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027elevation\u0027\u0027 of the pole, or of a star\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The angle which the style makes with the substylar line\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The movement of the axis of a piece in a vertical plane; also, the angle of elevation, that is, the angle between the axis of the piece and the line of sight; distinguished from direction\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A geometrical projection of a building, or other object, on a plane perpendicular to the horizon; orthographic projection on a vertical plane; called by the ancients the orthography\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The raising of the hos\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"host—representing Christ’s body—in a mass or Holy Communion service\", \"priority\":12}]}, \"synonyms\":{}}");

	add("elevator", "{\"term\":\"elevator\", \"etymology\":{\"influencers\":[], \"languages\":[\"crimean tatar\", \"English\"], \"text\":\"English grain {{l|en|elevator}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;!-- Note: If you edit this, don\u0027t change position of silo, it is referenced there as definition 2 in elevator--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Permanent construction with a built-in platform that is lifted vertically\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A silo used for storing wheat, corn or other grain (\u0027grain elevator\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A control surface of an aircraft responsible for controling the pitching motion of the machine\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Trademark for a type of shoe having an insert lift to make the wearer appear taller\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A dental instrument used to pry up (\u0026quot;elevate\u0026quot;) teeth in difficult extractions, or depressed portions of bone\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any muscle that serves to raise a part of the body, such as the leg or the eye\", \"priority\":7}]}, \"synonyms\":{}}");

